window.bookSummaryJSON = "<p>Adam Jamenson has suffered through the worst loss known to man. The only reason he lives day-to-day is to ensure the safety of his Pack. As the Enforcer of the Redwood Pack, it is his job to protect all in his path, though he was unable to protect the ones he held dear. The war with the Centrals is heating up and Adam must try and grit through it in order to survive. Though the broken man inside of him may not want to... </p> <p>Bay Milton is a werewolf with a past. And a secret. She's met the Redwoods' Enforcer only once, but it left a lasting effect. Now she needs to find him, or everything he had thought he lost, may be lost again. </p> <p>Together, they must struggle and find a way to fight their pasts and present in order to protect their future. But the Centrals have a plan that might make their path one of loss and destruction. </p>"; 
